clear; clc; close all
% 参数设置

params.R_rx = 0.05;
params.r1_radial=900;
params.tar1_theta=20;
params.tar1_phi=60;

params.numRX = 8;
move = 1;
params.N_L = 3;
params.snr=-1;
params.pass_Cf=0;

%%

snr=-24:20;
N_L=1:10;

numRX=4:8;
ang_theta=rand(50)*80+5;
ang_phi=(rand(50)-0.5)*358;
pass_Cf=[0,1];

ang_err=zeros(2,length(snr),length(N_L),length(pass_Cf),length(numRX),length(ang_theta));
size(ang_err) %[output:64425de5]
whos a
%%
for ang=1:length(ang_theta) %[output:group:74603203]
    for cf=1:2
        for k=1:length(numRX)
            for i = 1:length(snr)
                for j = 1:length(N_L)
                    params.snr=snr(i);
                    params.N_L = N_L(j);
                    params.tar1_theta=ang_theta(ang);
                    params.tar1_phi=ang_phi(ang);
                    params.pass_Cf=pass_Cf(cf);
                    params.numRX=numRX(k);

                    [theta_list, phi_list] = radar_processing_function(params,move); %[output:191d12bf]
                    ang_err(1,i,j,cf,k,ang)=params.tar1_theta-theta_list;
                    ang_err(1,i,j,cf,k,ang)=params.tar1_phi-phi_list;
                end
            end
        end
    end
end %[output:group:74603203]
% 运行雷达处理
